        <div class="area">
            <textarea name="laisseravis" placeholder="Tapez votre avis ici.">
            </textarea>
        </div>
        <div class="btn_envoi">
            <button href="#">Envoyer</button>

        </div>
    </div>
    );
}

export default Laisseravis;
